import "./PageFour.css"

function PageFour() {
    return(
        <div className="container">
            <div className="row">
                <div className="col-lg-6 col-md-4 col-sm-2">
                    <div className="textGallery">
                        <p className="headText">About hotel gallery</p>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default PageFour
